# VOLUNTARIOS  | Ante la creciente demanda de información oficial, confiable y útil EN ESPAÑOL sobre #coronavirus , en 
@esp_covid19  necesitamos voluntarios con experiencia en 
@squarespace  ó plataformas de blogs.  

Escríbenos a covid19espanol@gmail.com ó ¡ayúdanos a compartir!

Hello Mark, you can share our collective and volunteer effort  http:// covid19espanol.com    with your followers. We are translating verified and updated news about COVID19 to Spanish as fast as we can. 

@esp_covid19  is our Twitter. 
If we can help with something, let us know!
